import React from 'react'
import { useState } from 'react';
import { useEffect } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
const Header2 = () => {

    const[scrolled,setscrolled]=useState(false)
 
    useEffect(()=>{
       
      const scrolfun = () =>{
         
        if(window.scrollY > 10 ){
            console.log("true")
            setscrolled(true)
        }
        else{
            console.log("false")
            setscrolled(false)
        }
          
      }  

      window.addEventListener("scroll",scrolfun)

    },[scrolled])


    return (
        <>
         {/* className={scrolled ? "bg-grey tofiexd" : "bg-white" }  */}
            <Navbar collapseOnSelect expand="md" className={scrolled ? " fixed-top bg-white" : "sticky-top bg-dark"} >
                <Container>
                    <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="m-auto">
                            <Nav.Link href="#features" >Home</Nav.Link>
                            <Nav.Link href="#pricing">Reservation</Nav.Link>
                            <Nav.Link href="#pricing">History</Nav.Link>
                            <Nav.Link href="#pricing">Profile</Nav.Link>
                          
                        </Nav>
                        <Nav>
                            <Nav.Link href="#deets">More deets</Nav.Link>
                            <Nav.Link eventKey={2} href="#memes">
                                Dank memes
                            </Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </>
    )
}

export default Header2
